import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getChipDeleteUtilityClass(slot) {
  return generateUtilityClass('JoyChipDelete', slot);
}
const chipDeleteClasses = generateUtilityClasses('JoyChipDelete', ['root', 'disabled', 'focusVisible', 'colorPrimary', 'colorNeutral', 'colorDanger', 'colorInfo', 'colorSuccess', 'colorWarning', 'variantPlain', 'variantSolid', 'variantSoft', 'variantOutlined']);
export default chipDeleteClasses;
